import React from 'react';
import PropTypes from "prop-types";

function Food({name, picture, rating}) {
  return (
    <div>
      <h2>I like {name}</h2>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired
};

const foodILike = [
  {
    id:1,
    name: "apple",
    image: "data:image/jpeg;base64,",
    rating: 5
    
  },
  {
    id:2,
    name: "banana",
    image: "data:image/jpeg;base64,",
    rating: 4.9
  },
  {
    id:3,
    name: "orange",
    image: "data:image/jpeg;base64,",
    rating: 4.8
  },
  {
    id:4,
    name: "lemon",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR2Dn_aCHqdBcHSh39khPVZZ3Zr0X2C4ARxBg&usqp=CAU",
    rating: 5.5
  },
  {
    id:5,
    name: "pineapple",
    image: "data:image/jpeg;base64,",
    rating: 4.7
  }
];

function App() {
  return (
  <div>
    {foodILike.map(dish => (
      <Food key={dish.id} name={dish.name} picture={dish.image} rating={dish.rating}/>
    ))}
  </div>
  );
}

export default App;

